            <link rel="stylesheet" href='https://bootswatch.com/4/cerulean/bootstrap.min.css'>
            <link rel="stylesheet" href='https://bootstrap/dist/css/bootstrap.min.css'>
            </link>
                
            
            </link>
        </Head>
        <Navbar></Navbar>
        <div className='container'>
        {props.children}
        </div>
<footer style={divStyle}>
    <h1>good footer</h1>
</footer>
    </div>
    
    );
     const divStyle = {
        position: 'fixed',
        left: '0',
        bottom: '0',
        width: '100%',
        textAlign:'center',
        color: 'white',
        backgroundColor: 'gray',

      };
    export default Layout;
